# -*- coding: utf-8 -*-
import scrapy
from scrapy.http import FormRequest
from cl_login.spiders.user_pass import UserPass


class LoginSpider(scrapy.Spider):
    name = 'login'
    start_urls = ['https://accounts.craigslist.org/login']

    def parse(self, response):

        self.user_pass = UserPass()
        self.login = self.user_pass.login
        self.password = self.user_pass.password
        
        self.form_data = {
            'step': 'confirmation',
            'rt': '',
            'rp': '',
            't': '1581980113',
            'p': '0',
            'inputEmailHandle': self.login,
            'inputPassword': self.password,
            'browserinfo': '{"pow":"1581980113:8e5c2bc9d2bd88d101f4a506a5c3d71b","userAgent":"Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) snap Chromium/80.0.3987.100 Chrome/80.0.3987.100 Safari/537.36","webdriver":"NA","language":"en-US","colorDepth":24,"deviceMemory":8,"hardwareConcurrency":8,"screenResolution":[768,1366],"availableScreenResolution":[741,1366],"timezoneOffset":180,"timezone":"America/Sao_Paulo","sessionStorage":true,"localStorage":true,"indexedDb":true,"addBehavior":false,"openDatabase":true,"cpuClass":"NA","platform":"Linux x86_64","plugins":[["Chromium PDF Plugin","Portable Document Format",[["application/x-google-chrome-pdf","pdf"]]],["Chromium PDF Viewer","",[["application/pdf","pdf"]]]],"canvas":["canvas winding:yes","canvas fp:data:image/png;base64,"],"webglVendorAndRenderer":"Intel Open Source Technology Center~Mesa DRI Intel(R) UHD Graphics (Whiskey Lake 3x8 GT2) ","adBlock":false,"hasLiedLanguages":false,"hasLiedResolution":false,"hasLiedOs":false,"hasLiedBrowser":false,"touchSupport":[0,false,false],"fonts":["Arial","Bitstream Vera Sans Mono","Courier","Courier New","Helvetica","Times","Times New Roman","MONO"]}'
            }

        yield FormRequest.from_response(response=response,
                                        formxpath='//form[@class="loginform"]',
                                        callback=self.after_login,
                                        formdata=self.form_data)

    def after_login(self, response):
        email = response.xpath('//header[@class="account-header"]/a[2]/text()').get()
        yield{
            'email': email
            }
